import React from 'react'
import { Todo } from '../Todo/Todo'
import { v4 as uuidv4 } from 'uuid';


export class TodoList extends React.Component {

    render() {
        return (
            <div>
                {(this.props.todoList).map(todo => {
                    return <Todo todo={todo.description} key={uuidv4} />
                })}
            </div>
        )
    }
 }
